import './Login.css';
import { getAuth, signInWithPopup, GoogleAuthProvider, FacebookAuthProvider } from 'firebase/auth';

export default function Login() {


    const googleAuth = () => {
        const provider = new GoogleAuthProvider();
        const auth = getAuth();
        signInWithPopup(auth, provider).then((result) => {
            const credential = GoogleAuthProvider.credentialFromResult(result);
            const token = credential.accessToken;
            const user = result.user;
            console.log(user);
            console.log(token);
        }).catch((error) => {
            console.error(`An error has occured, Error Code: ${error.code}, Error Message: ${error.message}, Email of error causer: ${error.email}`);
        });
    }

    const facebookAuth = () => {
        const provider = new FacebookAuthProvider();
        const auth = getAuth();
        signInWithPopup(auth, provider).then((result) => {
            const user = result.user;
            const credential = FacebookAuthProvider.credentialFromResult(result);
            const accessToken = credential.accessToken;

            console.log(user);
            console.log(accessToken);
        })
    }

    return (
        <div className="Login">
            <div className="loginHeaders">
                <h1>Welcome to MultiCoder</h1>
                <p className="greyish">Login and start kicking!</p>
            </div>
            <div className="loginBtns">
                <button onClick={googleAuth}>Google</button>
                <button onClick={facebookAuth}>Facebook</button>
                <button>Github</button>
            </div>
        </div>
    )
}
